import {useState,useEffect} from "react";
import {getAllStudent} from "./Client";
import './App.css';

function App() {
    const [students,setStudents]=useState([]);
    const fetchStudents=()=>
        getAllStudent()
            .then(res => res.json())
            .then(data=>{
                console.log(data);
                setStudents(data);
            });
    useEffect(()=>{
        console.log("Component is Mounted");
        fetchStudents();
    },[]);
    if(students.length<=0){
        return "No Data"
    }
    return (
       students.map((student,index)=> <p key={index}>{student.id}{student.name}</p>)
    );
}

export default App;
